window.bookSummaryJSON = "<p>Cassandra Collins is forced to make a choice. She can do what she's told and have a safe, protected life. Or she can strike out on her own and make her own way.</p> <p>Cassandra chooses the easy path and regrets it her whole life.</p> <p>Until she dies and wakes up in her 18-year-old body, on the cusp of that same decision.</p> <p>What would you do if you could do it all again?</p> <p><i>Includes a special bonus note read by the author.</i></p>"; 
